    }

    #getAccount = async () => {
        try {
            const response = await fetch("http://localhost:4000/search/8");
            const jsonData = await response.json();
            
            this.state = JSON.parse(jsonData);

        } catch (error) {
            console.error(error);
        }
    };


    render(){
        const { goods } = this.state
